package main

import "strings"

func CycpatternCheck(a, b string) bool {
	// If b is longer than a, it can't be a substring of a or its rotations
	if len(b) > len(a) {
		return false
	}

	// Create a string that contains all rotations of b
	// For example, if b = "abc", doubled = "abcabc"
	// This allows us to find all rotations by checking substrings
	doubled := b + b

	// Check if any rotation of b is a substring of a
	// We iterate through all possible rotations of b
	for i := 0; i < len(b); i++ {
		rotation := doubled[i : i+len(b)]
		if strings.Contains(a, rotation) {
			return true
		}
	}

	return false
}
